YUI.add('js-enhancements', function(Y){	"use strict";	Y.namespace('Helpers');	//core javascript extensions	/* MAKE IE WORK */	if ( !Array.indexOf ) {		Array.prototype.indexOf = function (obj, start) {			var i;			for ( i = (start || 0); i < this.length; i++) {				if (this[i] === obj) {					return i;				}			}			return -1;		};	}	/* END MAKE IE WORK */		if ( !String.prototype.lpad ) {		String.prototype.lpad = function(chr, length){			var result = this;			while(result.length < length){				result = chr+result;			}			return result;		};	}		if ( !Array.prototype.forEach ) {		Array.prototype.forEach = function(fn, scope) {			for(var i = 0, len = this.length; i < len; ++i) {			  fn.call(scope || this, this[i], i, this);			}		};	}				/**	 * 	 * Generic case insensitive sort function	 **/	Y.Helpers.sortCaseInsensitive = function(a, b, desc){		var order;			a = a.get(this.key).toLowerCase(),			b = b.get(this.key).toLowerCase(),			order = a > b ? 1 : a < b ? -1 : 0;		return desc ? -order : order;	};}, '1.0.1');